import axios from "axios";

class TripServices {
  saveTrip(trip) {
    return axios.post(
      "http://localhost:8085/user/createtrip",
      { trip },
      {
        headers: {
          Authorization: localStorage.jwtToken,
          "Content-Type": "application/json",
        },
      }
    );
  }
}

export default new TripServices();
